import React, { Component } from 'react';

class Movie extends Component {
    state={
        count:this.props.Movie
    }
    render() {
        return (
            <div>
                <table className="table">
                    <tbody>
                        <tr>
                            <td>{this.count.id}</td>
                            <td>{this.count.name}</td>
                            <td></td>
                        </tr>
                    </tbody>
                </table>    
            </div>
        );
    }
}

export default Movie;
